const Button = ({ link, type = 'primary', text }) => {
  const className = (type === 'primary') ? 'main_button main_button--no-arrow main_button--bold' : 'secondary_button'
  return (
    <a
      rel='noreferrer noopener' target='_blank'
      href={link}
      className={className}
    >
      <FormattedMessage {...text} />
    </a>
  )
}

